import React from "react";
import { ReactDOM } from "react";
import './homepage.css'
function Homepage()
{
    return (
        <div>
            <ul>
                <li><a href="default.asp">Home</a></li>
                <li><a href="news.asp">News</a></li>
                <li><a href="contact.asp">Contact</a></li>
                <li><a href="about.asp">About</a></li>
                <li><a href="logo.asp"><img src="https://cdn.pixabay.com/photo/2023/01/12/07/19/rat-7713508_960_720.jpg" width={100}></img></a></li>
            </ul>
            <img  src="https://cdn.pixabay.com/photo/2022/12/16/01/41/balloons-7658766_960_720.jpg" width={1450}></img>
            
            <h>The Team</h>
            
        </div>
   );
}

export default Homepage
